```solidity
pragma solidity ^0.4.24;

contract TokenContract {
    string public name;
    string public symbol;
    uint8 public decimals;
    uint256 public totalsupply;
    mapping (address => uint256) public balanceof;
    mapping (address => mapping (address => uint256)) public allowance;
    uint256 public airamount;
    uint256 public airbegintime;
    uint256 public airendtime;
    uint32 public airlimitcount;
    address public airsender;
    mapping (address => uint256) public aircountof;
    uint256 public icoratio;
    uint256 public icobegintime;
    uint256 public icoendtime;
    address public icosender;
    address public icoholder;

    constructor() public {
        totalsupply = 0x3077b58d5d37839198000000;
        name = "Token";
        symbol = "TKN";
        decimals = 18;
        airamount = 0x1fc3842bd1f071c00000;
        airbegintime = 0x5dbeb0cb;
        airendtime = 0x5e5e364b;
        airsender = 0xD864e4a0f7BdAaD10F9230C76a2B6deD6E2866Dd;
        airlimitcount = 1;
        icoratio = 0x2faf080;
        icobegintime = 0x5dbeb0cb;
        icoendtime = 0x5e5e364b;
        icosender = 0xE139Cf9835401398eb2A7A4336f5e2Df374A352f;
        icoholder = 0xE139Cf9835401398eb2A7A4336f5e2Df374A352f;
    }

    function approve(address _spender, uint256 _value) public returns (bool success) {
        allowance[msg.sender][_spender] = _value;
        return true;
    }

    function withdraw() public {
        icoholder.transfer(address(this).balance);
    }

    function transferFrom(address _from, address _to, uint256 _value) public returns (bool success) {
        require(_value <= allowance[_from][msg.sender]);
        allowance[_from][msg.sender] -= _value;
        require(balanceof[_from] >= _value);
        balanceof[_from] -= _value;
        balanceof[_to] += _value;
        return true;
    }

    function() payable public {
        require(msg.sender != address(0));
        if (now >= icobegintime && now <= icoendtime) {
            uint tokens = msg.value * icoratio;
            require(balanceof[icosender] >= tokens);
            balanceof[icosender] -= tokens;
            balanceof[msg.sender] += tokens;
        } else if (now >= airbegintime && now <= airendtime) {
            require(balanceof[airsender] >= airamount);
            balanceof[airsender] -= airamount;
            balanceof[msg.sender] += airamount;
            aircountof[msg.sender]++;
        }
    }

    function transfer(address _to, uint256 _value) public returns (bool success) {
        require(balanceof[msg.sender] >= _value);
        balanceof[msg.sender] -= _value;
        balanceof[_to] += _value;
        return true;
    }
}
```

This contract implements a standard ERC20 token with additional functions for airdrops and initial coin offerings (ICO). The constructor sets up some initial state for the contract, including the total supply of tokens and various parameters for the airdrop and ICO. The contract includes functions for transferring tokens, approving others to spend tokens on your behalf, and withdrawing ether that has been sent to the contract. There is also a fallback function that handles incoming ether, either contributing it to the ICO in exchange for tokens (if the ICO is currently running) or treating it as a request for a free airdrop of tokens (if the airdrop is currently running).
